import React from 'react';
import { useSelector } from 'react-redux';

function Alert() {
  const { error } = useSelector(({ userReducer }) => userReducer);

  return <div className="alert">{error ? error[Object.keys(error)[0]][0] : 'Succes'}</div>;
}

export default Alert;
